import React, {Component} from 'react';
class Menubar extends Component{
    render(){
      return(
        <nav class="nav nav-pills flex-column flex-sm-row " className="navbar">
        <a class="flex-sm-fill text-sm-center nav-link active text-black" href="#">메뉴</a>
        <a class="flex-sm-fill text-sm-center nav-link text-black" href="#">Longer nav link</a>
        <a class="flex-sm-fill text-sm-center nav-link text-black" href="#">Link</a>
        <a class="flex-sm-fill text-sm-center nav-link disabled text-black" href="#" tabindex="-1" aria-disabled="true">Disabled</a>
        
      </nav>
      );
    }
  }
export default Menubar;
